function check_product_quantity(value)
{
    var button = $('.addToCartButton');
    var error  = $('.input_product_quantity_error');

    button.attr('data-disabled', 'true');

    if (value.val() >= 100) {
        if (value.val() % 100 == 0) {
                        button.attr('data-disabled', 'false');
            error.empty();

            return true;
                    } else {
            error.html('La quantité doit être un multiple de 100');

            return false;
        }
    } else {
        error.html('La quantité doit être au moins de 100');

        return false;
    }
}

$(function() {
    $('.decrement').click(function () {
        $('.input_product_quantity_error').empty();
        $('.addToCartButton').attr('data-disabled', 'false');

        var value = $('.input_product_quantity');
        var nextValue = parseInt(value.val()) - 100;

        if (nextValue >= 100) {
                        if (nextValue % 100 != 0) {
                value.val(100);
            } else {
                value.val(nextValue);
            }
                    } else {
            value.val(100);
        }
    });

    $('.increment').click(function () {
        $('.input_product_quantity_error').empty();
        $('.addToCartButton').attr('data-disabled', 'false');

        var value = $('.input_product_quantity');

        if (value.val() % 100 != 0) {
            value.val(100);
        }

        var nextValue = parseInt(value.val()) + 100;

                if (nextValue < 100) {
            value.val(100);
        } else {
            value.val(nextValue);
        }
            });
});
